column8:
「ニューボーン WブロウEX B6 (ナチュラルブラウン)」は、ペンシル&amp;パウダー&amp;ブラシの3つの機能でナチュラル眉に仕上げるアイブロウです。ぼかし込みも繊細なラインも自在にキープします。<br>●ペンシル：細かく描ける楕円芯。<br>●パウダー：ふんわり密着。<br>●ブラシ：ぼかしてフィニッシュ。<br>●ナチュラルブラウン：茶色の髪色の方に。 <br><br>使用方法<br><br>Step1. ペンシル<br>眉尻まで1本1本描き足します。<br>Step2. パウダー<br>眉に沿ってふんわり描き足します。<br>Step3. ブラシ<br>ぼかしながら毛流れをととのえて完成。 <br><br>ご注意<br>●傷・はれもの・しっしん等異常のあるときは、お使いにならないでください。<br>●使用中、または使用後日光にあたって、赤み・はれ・かゆみ・刺激等の異常があらわれたときは、使用を中止し、皮フ科専門医等にご相談されることをおすすめします。そのまま化粧品類の使用を続けますと悪化することがあります。 <br><br>4964596417269<br><br>02414 ＊サナ　ＮＢ　ＷブロウＥＸ　Ｎ　Ｂ６　　　　　　　<br>　　　　　　　　　<br>　<br><br>原産国：日本<br><br>区分：化粧品<br><br>発売元、製造元、輸入元又は販売元：常盤薬品工業株式会社<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
